/**
 * @license
 * jsPDF - PDF/UA Default Font Module
 * 
 * This module provides the default accessible font for PDF/UA (Universal Accessibility) mode.
 * 
 * Font: Atkinson Hyperlegible Regular
 * Designer: Braille Institute of America
 * License: SIL Open Font License v1.1 (OFL)
 * 
 * Why Atkinson Hyperlegible?
 * ==========================
 * 
 * Atkinson Hyperlegible was specifically designed by the Braille Institute to enhance
 * readability for readers with low vision. It excels in several key areas:
 * 
 * 1. **Character Distinction**: Greater differentiation between similar characters
 *    - I (capital i), l (lowercase L), 1 (one) are clearly distinct
 *    - 0 (zero) vs O (capital o) easily distinguishable
 * 
 * 2. **Magnification**: Maintains clarity when magnified, critical for low vision users
 * 
 * 3. **Large Counters**: Open spaces within letters (e.g., inside 'e', 'a') are larger,
 *    improving recognition at small sizes or when vision is impaired
 * 
 * 4. **Accessibility Focus**: Developed with input from low vision specialists and
 *    tested extensively with users who have visual impairments
 * 
 * 5. **Professional Appearance**: Modern, clean design suitable for documents
 * 
 * This makes it superior to generic fonts like Liberation Sans or Arial for PDF/UA
 * documents, where accessibility is the primary concern.
 * 
 * Font Metrics:
 * - Regular weight: ~56 KB (TTF)
 * - Base64 encoded: ~72 KB
 * - Full family available: Regular, Bold, Italic, BoldItalic
 * 
 * For PDF/UA compliance, this font is automatically loaded when `pdfUA: true` option
 * is set during jsPDF initialization.
 * 
 * @module pdfua_fonts
 */

/**
 * Default font object for PDF/UA mode
 * @type {Object}
 * @property {string} name - Internal font name used by jsPDF
 * @property {string} filename - Font filename for VFS
 * @property {string} style - Font style (normal, italic)
 * @property {string} weight - Font weight (normal, bold)
 * @property {string} data - Base64-encoded TTF font data
 * @property {Object} metadata - Font metadata for documentation
 */
export const PDFUA_DEFAULT_FONT = {
  name: "AtkinsonHyperlegible",
  filename: "AtkinsonHyperlegible-Regular.ttf",
  style: "normal",
  weight: "normal",
  data: "",
  metadata: {
    fullName: "Atkinson Hyperlegible Regular",
    family: "Atkinson Hyperlegible",
    designer: "Braille Institute of America",
    license: "SIL Open Font License v1.1",
    version: "2020",
    url: "https://brailleinstitute.org/freefont",
    features: [
      "Enhanced character distinction",
      "Optimized for low vision",
      "Large counters for clarity",
      "Excellent magnification properties",
      "Professional appearance",
      "Extensive Unicode coverage"
    ]
  }
};

/**
 * Get the default font for PDF/UA mode
 * @returns {Object} Font configuration object
 */
export function getPDFUADefaultFont() {
  return PDFUA_DEFAULT_FONT;
}

/**
 * Atkinson Hyperlegible Bold
 * Base64-encoded TrueType font data
 */
export const AtkinsonHyperlegibleBold = '';

/**
 * Atkinson Hyperlegible Italic
 * Base64-encoded TrueType font data
 */
export const AtkinsonHyperlegibleItalic = '';

/**
 * Atkinson Hyperlegible Bold Italic
 * Base64-encoded TrueType font data
 */
export const AtkinsonHyperlegibleBoldItalic = '';
